import "./Timer.css";
import { useState } from "react";
function Timer() {
  let [num, setNum] = useState(0);
  let increaseBtn = () => {
    setNum(num + 1);
  };
  let decreaseBtn = () => {
    setNum(num - 1);
  };
  let resetBtn = () => {
    setNum(0);
  };
  return (
    <>
      <div className="container">
        <h1>{num}</h1>
        <button onClick={increaseBtn}>increase</button>
        {num > 0(<button onClick={decreaseBtn}>decrease</button>)}

{num }        <button onClick={resetBtn}>reset</button>
      </div>
    </>
  );
}
export default Timer;
